contract MinerContract is Context, Ownable {
    using SafeMath for uint256;


    address gfc = 0xEc0f013A108d3639219Fa8210D5c7435E112332F;
    uint256 private EGGS_TO_HATCH_1MINERS = 1080000;//for final version should be seconds in a day
    uint256 private PSN = 10000;
    uint256 private PSNH = 5000;
    uint256 private devFeeVal = 3;
    bool private initialized = false;
    address private ceoAddress;
    mapping (address => uint256) private hatcheryMiners;
    mapping (address => uint256) private claimedEggs;
    mapping (address => uint256) private lastHatch;
    mapping (address => address) private referrals;
    uint256 private marketEggs=0;

    constructor() {
        //deploy from address that aquires fees
        ceoAddress = msg.sender;


    }

    //creates miners from the eggs, REBAKE
    function hatchEggs(address ref) public {
        require(initialized);

        if(ref == msg.sender) {
            ref = address(0);
        }

        if(referrals[msg.sender] == address(0) && referrals[msg.sender] != msg.sender) {
            referrals[msg.sender] = ref;
        }

        uint256 eggsUsed = getMyEggs(msg.sender);
        uint256 newMiners = SafeMath.div(eggsUsed,EGGS_TO_HATCH_1MINERS);
        hatcheryMiners[msg.sender] = SafeMath.add(hatcheryMiners[msg.sender],newMiners);
        claimedEggs[msg.sender] = 0;
        lastHatch[msg.sender] = block.timestamp;

        //send referral eggs
        claimedEggs[referrals[msg.sender]] = SafeMath.add(claimedEggs[referrals[msg.sender]],SafeMath.div(eggsUsed,8));

        //boost market to nerf miners hoarding
        marketEggs=SafeMath.add(marketEggs,SafeMath.div(eggsUsed,5));
    }

    function sellEggs() payable public {
        require(initialized);
        uint256 hasEggs = getMyEggs(msg.sender);
        uint256 eggValue = calculateEggSell(hasEggs);
        uint256 fee = devFee(eggValue);
        claimedEggs[msg.sender] = 0;
        lastHatch[msg.sender] = block.timestamp;
        marketEggs = SafeMath.add(marketEggs,hasEggs);
        ERC20(gfc).transferFrom(msg.sender, ceoAddress, fee);
        ERC20(gfc).transfer(msg.sender,SafeMath.sub(eggValue,fee));
    }

    function beanRewards(address adr) public returns(uint256) {
        uint256 hasEggs = getMyEggs(adr);
        uint256 eggValue = calculateEggSell(hasEggs);
        return eggValue;
    }

    function buyEggs(address ref, uint256 value) public payable {
        require(initialized);

        ERC20(gfc).transferFrom(address(msg.sender), address(this), value);

        uint256 eggsBought = calculateEggBuy(value,SafeMath.sub(ERC20(gfc).balanceOf(address(this)),value));
        eggsBought = SafeMath.sub(eggsBought,devFee(eggsBought));
        uint256 fee = devFee(value);
         ERC20(gfc).transferFrom(msg.sender, ceoAddress, fee);
        claimedEggs[msg.sender] = SafeMath.add(claimedEggs[msg.sender],eggsBought);
        hatchEggs(ref);
    }

    function calculateTrade(uint256 rt,uint256 rs, uint256 bs) private view returns(uint256) {
        return SafeMath.div(SafeMath.mul(PSN,bs),SafeMath.add(PSNH,SafeMath.div(SafeMath.add(SafeMath.mul(PSN,rs),SafeMath.mul(PSNH,rt)),rt)));
    }

    function calculateEggSell(uint256 eggs) public returns(uint256) {
        return calculateTrade(eggs,marketEggs, getBalance());
    }

    function calculateEggBuy(uint256 eth,uint256 contractBalance) public view returns(uint256) {
        return calculateTrade(eth,contractBalance,marketEggs);
    }

    //
    function calculateEggBuySimple(uint256 eth) public view returns(uint256) {
        //10% less than what's shown
        return calculateEggBuy(eth,address(this).balance);
    }

    function devFee(uint256 amount) private view returns(uint256) {
        return SafeMath.div(SafeMath.mul(amount,devFeeVal),100);
    }

    function seedMarket(uint256 value) public payable onlyOwner {
        require(marketEggs == 0);
        require(msg.sender == ceoAddress);
        ERC20(gfc).transferFrom(address(msg.sender), address(this), value);
        initialized = true;
        marketEggs = 108000000000;
    }

    //return GFC within contract
    function getBalance() public returns(uint256) {
        return ERC20(gfc).balanceOf(address(this));
    }

    //returns current # of miners
    function getMyMiners(address adr) public view returns(uint256) {
        return hatcheryMiners[adr];
    }

    //adds new eggs with old
    function getMyEggs(address adr) public view returns(uint256) {
        return SafeMath.add(claimedEggs[adr],getEggsSinceLastHatch(adr));
    }

    //hatch occurs on rebake and sell
    function getEggsSinceLastHatch(address adr) public view returns(uint256) {
        uint256 secondsPassed=min(EGGS_TO_HATCH_1MINERS,SafeMath.sub(block.timestamp,lastHatch[adr]));
        return SafeMath.mul(secondsPassed,hatcheryMiners[adr]);
    }

    function min(uint256 a, uint256 b) private pure returns (uint256) {
        return a < b ? a : b;
    }
}

